import createAccImage from "../assets/images/accountSplash.png";
import logoSvg from "../assets/icons/Storefront.svg";
import discordSvg from "../assets/icons/DiscordLogo.svg"
import youtubeSvg from "../assets/icons/YoutubeLogo.svg"
import twitterSvg from "../assets/icons/TwitterLogo.svg"
import instagramSvg from "../assets/icons/InstagramLogo.svg"

export const image = {
    createAccImage,
    logoSvg
}
